import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import Login from './components/Login';
import Dashboard from './components/Dashboard';
import Transcript from './components/Transcript';
import RegisterCourses from './components/RegisterCourses';
import SwapSection from './components/SwapSection';
import ResetPassword from './components/ResetPassword';  // Import ResetPassword

function App() {
  return (
    <Router>
      <Routes>
        <Route path="/" element={<Login />} />
        <Route path="/dashboard" element={<Dashboard />} />
        <Route path="/transcript" element={<Transcript />} />
        <Route path="/register" element={<RegisterCourses />} />
        <Route path="/swap" element={<SwapSection />} />
        <Route path="/reset-password" element={<ResetPassword />} />  {/* Add Route */}
      </Routes>
    </Router>
  );
}

export default App;
